import React from 'react'

import { Container, CopyrightContainer, Copy } from './styledComponents'

export const Footer: React.FC = () => {
	return (
		<Container>
			<CopyrightContainer>
				<Copy>I love you so much babe.</Copy>
			</CopyrightContainer>
		</Container>
	)
}
